import Logo from '../components/Logo';

const Index = () => (
  <div>
    <div className = "centered">
      <div className = "content">
        <div className = "header">
          <Logo />
        </div>
        <h2>michael c. martinez</h2>
        <p>I am a web developer currently building things with <a href="https://dialup.digital">DIAL UP Digital.</a>
        In my free time I <a href="https://github.com/harsimus">code</a> and <a href="https://twitter.com/harsimus">twitter</a>
        about fighting games.
        If you want more details you can check out my <a href="./public/MCMResume.pdf" download>resume</a>
        and feel free to <a href="mailto:michael@harsim.us">e-mail</a> me whenever.</p>
        <a href="https://github.com/harsimus">github</a>
      </div>
    </div>

    <style>
      {`
        html {
          position: relative;
          background-color: #000000;
        }

        body {
          margin: 0px !important;
          font-family: Helvetica, Arial, Sans-Serif;
          font-weight: bold;
          color: #FFFFFF;
        }

        a:link {
          color: #9D2F90;
          text-decoration: none;
          transition: 0.3s;
        }

        a:hover {
          color: #A44ABC;
        }

        a:visited {
          color: #9F034A;
        }

        .centered {
          position: fixed;
          top: 50%;
          left: 50%;
          transform: translate(-50%, -50%);
        }

        .header {
          margin: 0 auto;
          text-align: center;
        }

        .content {
          text-align: justify;
          text-justify: inter-word;
          width
        }
      `}
    </style>
  </div>
);

export default Index;
